 helgen er Azarael, Helgen af opofrelse. Ikke meget vides om Azaraels tidligere liv, nogen siger han var en præst for en anden helgen, nogen siger han var en tigger, det eneste der vides med sikkerhed er at Azaraels er den helgen flest mennesker påstår at have set. Han er en af de mest tilbedte helgener, og hans tilbedere har flere religiøse heligdage hvor de går rundt og ofresig for andres ve og vel, eftersigende for at komme tættere på at efterligne Azarael. Der findes derfor næsten altid en kult til Azarael i enhver by som består af mere end et bondehus og en svinesti, og om ikke andet er der ihvertfald en helligdom man kan tilbede ved byens markedsplads/andedam.logseq____&quot;,536870973]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536870973]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^Flogseq____&quot;,984,536870973]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^Xlogseq____&quot;,984,536870973]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^Vlogseq____&quot;,984,536870973]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^Ulogseq____&quot;,984,536870973]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u664653b2-66f4-4321-9a06-e43917d1eb28logseq____&quot;,536870973]],[logseq____&quot;^15logseq____&quot;,[986,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;![](https://i.imgur.com/wrGaotw.jpeg){:height 808, :width 514}logseq____&quot;,536870973]],[logseq____&quot;^15logseq____&quot;,[986,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536870973]],[logseq____&quot;^15logseq____&quot;,[986,logseq____&quot;^Flogseq____&quot;,985,536870973]],[logseq____&quot;^15logseq____&quot;,[986,logseq____&quot;^Xlogseq____&quot;,984,536870973]],[logseq____&quot;^15logseq____&quot;,[986,logseq____&quot;^Vlogseq____&quot;,984,536870973]],[logseq____&quot;^15logseq____&quot;,[986,logseq____  <script type="text/javascript">// Single Page Apps for GitHub Pages

      // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
